:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Samuel and WILLIAMS, Mary
  01> WILLIAMS, Marianne Jane
  b 12.09.1852 d 18.09.1852
  Marianne b. and d. at Otaki.
  62> WILLIAMS, Anna Lydia
  b 06.07.1854 d 20.06.1938
  Lydia b. at Otaki and d. at Napier. She began to lose her sight at the age of 18 and was completely blind by
  the time she was 22. She had a keen mind and retained a lively interest in local and world events, and in the
  progress of the Church's mission, throughout her life.
  03> WILLIAMS, William Temple m on 31.03.1891 to PUCKEY, Annie Matilda Sophia Marilla
  b 16.03.1856 d 01.04.1928
  b 26.06.1858 d 22.08.1938
  William b. at Te Aute, m. at St Barnabas Church, Mount Ede, Auckland and d. at Te
  Aute. William and Annie both bd, at Pukehou Cemetery.
  William suffered poor health as a child and in 1886 his parents sent him to England
  for treatment. He spent several years in spas and sanatoria in England and Switzerland
  and returned much improved. He helped with the running of "Te Aute" station and
  supervised the work on the farm after his father's death.
  01> WILLIAMS, Dorothy Frances m on 20.04.1925 to JACKSON, Thomas Cecil Rhodes
  b 22.02.1892 d 26.07.1946
  b 21.08.1902 d 01.03.1981
  Dorothy b. at Hastings and bd. at Waikanae Cemetery. Thomas cremated and ashes buried on his farm. Thomas
  was an officer in the Merchant Marine then farmed at "Durslade", Hopelands, Woodville from 1925 until his
  death.
  01> JACKSON, Barbara Ann Mary
  b 27.06.1926
  Barbara b, at Hopelands, Woodville. Address: 2b George Place, Havelock North.
  Barbara was the kindergarten teacher at the Rudolf Steiner School in Hastings from 1955 to 1979.
  02> JACKSON, Michael Rhodes m on 02.09.1959 to PARKER, Margaret Alice Janette
  b 02.01.1929
  b 10.09.1930
  Michael 6. at Hastings and m. at Napier. Margaret, d/o Thomas Philip Parker and Alice Muriel Archer.
  Address: Pax Hill Farm, RD 2, Kaikohe, Northland.
  Michael was educated at Wanganui Collegiate School. He and Margaret had a peach and rose nursery from
  1957 and went sheep and cattle farming near Te Pohue from 1970. They have been at Pax Hill Farm, a
  property of 640 acres, since 1979.
